import React, { useState } from 'react';
import { useLocation, useNavigate } from 'react-router-dom';
import { loadStripe } from '@stripe/stripe-js';
import { Elements, PaymentElement, useStripe, useElements } from '@stripe/react-stripe-js';
import './PaymentPage.css';

// Load Stripe
const stripePromise = loadStripe('your-publishable-key-here');

const CheckoutForm = () => {
  const stripe = useStripe();
  const elements = useElements();
  const navigate = useNavigate();
  const [email, setEmail] = useState('');

  const handleSubmit = async (e) => {
    e.preventDefault();

    if (!stripe || !elements) return;

    // Simulate payment submission for now
    const { error } = await stripe.confirmPayment({
      elements,
      confirmParams: {
        return_url: 'http://localhost:3000/payment-success',
      },
    });

    if (error) {
      console.error(error.message);
      navigate('/payment-failure');
    } else {
      navigate('/payment-success');
    }
  };

  return (
    <form onSubmit={handleSubmit} className="checkout-form">
      {/* Email Input */}
      <div className="form-group">
        <label htmlFor="email">Email Address</label>
        <input
          type="email"
          id="email"
          value={email}
          onChange={(e) => setEmail(e.target.value)}
          placeholder="you@example.com"
          required
        />
      </div>

      {/* Stripe Payment Element */}
      <PaymentElement />

      {/* Submit Button */}
      <button type="submit" className="pay-button">
        Pay Now
      </button>
    </form>
  );
};

const PaymentPage = () => {
  const location = useLocation();
  const { title, price, quantity } = location.state || {};
  const subtotal = price * quantity;
  const tax = subtotal * 0.05; // Example tax rate: 5%
  const total = subtotal + tax;

  return (
    <Elements stripe={stripePromise}>
      <div className="payment-container">
        <h1>Checkout</h1>

        {/* Express Checkout */}
        <section className="express-checkout">
          <h2>Express Checkout</h2>
          <div className="express-buttons">
            <button className="link-pay">Pay with Link</button>
            <button className="google-pay">Google Pay</button>
          </div>
          <div className="separator">
            <span>or</span>
          </div>
        </section>

        {/* Order Summary */}
        <section className="order-summary">
          <h2>Order Summary</h2>
          <div className="product-details">
            <div className="product-item">
              <img src="https://via.placeholder.com/60" alt="Event Poster" />
              <div className="product-info">
                <h3>{title}</h3>
                <p>Quantity: {quantity}</p>
              </div>
              <div className="product-price">₹{subtotal}</div>
            </div>
          </div>
          <div className="total-section">
            <div className="total-row">
              <span>Subtotal</span>
              <span>₹{subtotal}</span>
            </div>
            <div className="total-row">
              <span>Tax (5%)</span>
              <span>₹{tax.toFixed(2)}</span>
            </div>
            <div className="total-row final">
              <span>Total</span>
              <span>₹{total.toFixed(2)}</span>
            </div>
          </div>
        </section>

        {/* Payment Form */}
        <CheckoutForm />
      </div>
    </Elements>
  );
};

export default PaymentPage;
